//本人只是代投"

text3:
"@学艺不精的门外汉
@MZMCRAFT
@抖抖村
@Krenz官方账号
我以前都是你们的忠实粉丝，我希望你们能给我一个回应。关于绘画这条道路，我跟着你们仿佛走了歪路。
曾经的我那么喜欢你们，把你们当做我心里的偶像。
现在的我连一份原画的工作都找不到，还在做着厨师，每天生活在崩溃之中，幡然醒悟自己好像走了错路。
我希望这条视频能被更多人看到。
也真心期望你们能给我一个答复。
#抖抖村##学艺不精的门外汉##MZMCRAFT##Krenz官方账号##绘圈#"
